    slide: {
        padding: '1em',
        margin: 0,
        minHeight: "100vh",
        color: '#191919',
        textAlign: 'center'
    }
};

const Welcome = () => (
    <div className="swiper">
        <SwipeableViews enableMouseEvents>
            <div style={Object.assign({}, styles.slide)}>
                <button class="brand-button">BRANDING/LOGO</button>
            </div>
